import React from 'react';

class App extends React.Component {

  constructor(props) {
    super(props);
    this.state = {
      cards52: [
        { suit: 'clubs' },
        { number: "5" }
      ]
    };
  }

  render() {
    const cards = this.state.cards52.map((card, index) => {
      return <h1 key={index}>{card}</h1>
    });
    return (
      
      <div>
        Cardz yo: {this.state.cards52}
      </div>
    );
  }
}

export default App;
